'use strict';(function(){const indexCfg={encode:false,tokenize:function(str){const chineseRegex=/\W/;let words=str.split(/\s/);return words.flatMap(word=>{if(chineseRegex.test(word)){return word.split('');}else{return[word];}});}};indexCfg.doc={id:'id',field:['title','content'],store:['title','href'],};const index=FlexSearch.create('balance',indexCfg);window.bookSearchIndex=index;index.add({'id':0,'href':'/notes/docs/tools/api/','title':"API",'content':"seafile  上传文件：https://download.seafile.com/published/web-api/v2.1/file-upload.md  目录  seafile   "});index.add({'id':1,'href':'/notes/docs/program/bash/','title':"Bash",'content':"颜色[1] 表 1: 终端颜色转义码列表    颜色 转义码    正常 \\e[0m  红色 \\e[31m  绿色 \\e[32m     状态码[2] 表 2: 状态码    状态码 含义    1 其他错误  2 使用 shell 内建命令出错  126 命令无法执行  127 命令未找到  128 无效的参数  130 取消     备忘单 https://devhints.io/bash。\n参考文献 [1] FLOZZ. Bash tips: Colors and formatting (ANSI/VT100 Control sequences)[EB/OL]([日期不详]). https://misc.flogisoft.com/bash/tip_colors_and_formatting.\n [2] ORNBO G. Linux and Unix exit code tutorial with examples[EB/OL](2019–11–16). https://shapeshed.com/unix-exit-codes/.\n  目录  颜色[1] 状态码[2] 备忘单 参考文献   "});index.add({'id':2,'href':'/notes/categories/','title':"Categories",'content':""});index.add({'id':3,'href':'/notes/docs/program/css/','title':"CSS",'content':"对齐 # 靠右对齐 text-align: right; width[1]  默认值：auto  参考文献 [1] W3SCHOOLS. CSS width Property[EB/OL]([日期不详]). https://www.w3schools.com/cssref/pr_dim_width.asp.\n  目录  对齐 width[1] 参考文献   "});index.add({'id':4,'href':'/notes/docs/','title':"Docs",'content':""});index.add({'id':5,'href':'/notes/docs/program/golang/','title':"Golang",'content':"time 时间格式  2006-01-02 15:04:05 -0700  目录  time  时间格式    "});index.add({'id':6,'href':'/notes/docs/program/html/','title':"HTML",'content':"Language Code[1] 表 1: ISO 639-1 Language Codes    Language ISO Code    Chinese (Simplified) zh-Hans     参考文献 [1] W3SCHOOLS. HTML Language Code Reference[EB/OL]([日期不详]). https://www.w3schools.com/tags/ref_language_codes.asp.\n  目录  Language Code[1] 参考文献   "});index.add({'id':7,'href':'/notes/docs/program/js/','title':"JavaScript",'content':"Array flatMap[1] 等价于先 map() 再 flat()。\nlet arr1 = [1, 2, 3, 4];  arr1.map(x =\u0026gt; [x * 2]);  // [[2], [4], [6], [8]]  arr1.flatMap(x =\u0026gt; [x * 2]); // [2, 4, 6, 8]  // only one level is flattened arr1.flatMap(x =\u0026gt; [[x * 2]]); // [[2], [4], [6], [8]] 正则表达式  表 1: JavaScript 常用正则表达式    代码 含义    \\s 单个空白字符，等价于 [ \\f\\n\\r\\t\\v\\u00a0\\u1680\\u2000-\\u200a\\u2028\\u2029\\u202f\\u205f\\u3000\\ufeff]  \\W 非基本拉丁字母，等价于 [^A-Za-z0-9_]     导航到新地址[2] window.location.href = \u0026#39;...\u0026#39;; 得到链接的 href 属性[3] document.getElementById(\u0026quot;aaa\u0026quot;).href; 移动元素[4] newParent.appendChild(element); 参考文献 [1] MDN. Array.prototype.flatMap()[EB/OL]([日期不详]). https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/flatMap.\n [2] STACKOVERFLOW. How to get the browser to navigate to URL in JavaScript [duplicate][EB/OL](2009–08–04). https://stackoverflow.com/a/1226718.\n [3] STACKOVERFLOW. Get local href value from anchor (a) tag[EB/OL](2013–03–15). https://stackoverflow.com/a/15439946.\n [4] STACKOVERFLOW. How to move all HTML element children to another parent using JavaScript?[EB/OL](2014–01–03). https://stackoverflow.com/questions/20910147/how-to-move-all-html-element-children-to-another-parent-using-javascript.\n  目录  Array  flatMap[1]  正则表达式 导航到新地址[2] 得到链接的 href 属性[3] 移动元素[4] 参考文献   "});index.add({'id':8,'href':'/notes/docs/tools/linux/','title':"Linux",'content':"手册 tldr # 安装 sudo pacman -S tldr 查找字符串 ripgrep # 在 python 文件里搜索 rg -tpy foo grep[1] grep -rl \u0026quot;string\u0026quot; /path 网络 curl 上传时显示进度条[2] curl ... | tee /dev/null urlencode 参数[3] curl ... --data-urlencode \u0026quot;paramName=value\u0026quot; 终端 tmux # 列出会话 tmux ls  # 创建新会话 tmux new -s myname  # 连接会话 tmux a -t myname 硬盘  https://github.com/bootandy/dust  jq 过滤[4] select(.name == \u0026quot;TAG\u0026quot;) Print strings without quotes[5] jq --raw-output CPU cat /proc/cpuinfo 参考文献 [1] ASKUBUNTU. How to use \"grep\" command to find text including subdirectories[EB/OL](2011–08–01). https://askubuntu.com/questions/55325/how-to-use-grep-command-to-find-text-including-subdirectories.\n [2] STACKOVERFLOW. cURL: How to display progress information while uploading?[EB/OL](2012–04–02). https://stackoverflow.com/questions/9973056/curl-how-to-display-progress-information-while-uploading/41860083.\n [3] STACKOVERFLOW. How to urlencode data for curl command?[EB/OL](2017–08–14). https://stackoverflow.com/questions/296536/how-to-urlencode-data-for-curl-command.\n [4] STEDOLAN. Cookbook[EB/OL](2019–10–05). https://github.com/stedolan/jq/wiki/Cookbook.\n [5] GITHUB. Print strings without quotes[EB/OL](2013–12–20). https://github.com/stedolan/jq/issues/250.\n  目录  手册  tldr  查找字符串  ripgrep grep[1]  网络  curl  上传时显示进度条[2] urlencode 参数[3]   终端  tmux  硬盘 jq  过滤[4] Print strings without quotes[5]  CPU 参考文献   "});index.add({'id':9,'href':'/notes/docs/program/python/','title':"Python",'content':"内建函数[1] property 定义属性，默认只读。\nclass Parrot:  def __init__(self):  self._voltage = 100000   @property  def voltage(self):  \u0026quot;\u0026quot;\u0026quot;Get the current voltage.\u0026quot;\u0026quot;\u0026quot;  return self._voltage classmethod 带 cls 的类方法。\nclass C:  @classmethod  def f(cls, arg1, arg2, ...): ... 参考文献 [1] PYTHON. Built-in Functions[EB/OL]([日期不详]). https://docs.python.org/3/library/functions.html#built-in-functions.\n  目录  内建函数[1]  property classmethod  参考文献   "});index.add({'id':10,'href':'/notes/tags/','title':"Tags",'content':""});index.add({'id':11,'href':'/notes/docs/program/tex/','title':"TeX",'content':"数学表达式的 \\(\\TeX\\) 表示 数学表达式的 \\(\\TeX\\) 表示    数学表达式 含义 \\(\\TeX\\) 表示    \\(\\{n \\mid 0 \\le n \\le 19\\}\\) 集合 \\{n \\mid 0 \\le n \\le 19\\}  \\(\\bar{p}\\) 平均值 \\bar{p}  \\(\\langle, \\rangle\\) 内积 \\langle, \\rangle    公式对齐[1] \\begin{align} 2x - 5y \u0026amp;= 8 \\\\ 3x + 9y \u0026amp;= -12 \\end{align}  align* 表示不编号[2]。\n 参考文献 [1] OVERLEAF. Aligning equations with amsmath[EB/OL]([日期不详]). https://www.overleaf.com/learn/latex/Aligning_equations_with_amsmath.\n [2] KOTTWITZ S. What’s the difference between align and align*?[EB/OL](2011–01–23). https://tex.stackexchange.com/a/9515.\n  目录  数学表达式的 \\(\\TeX\\) 表示 公式对齐[1] 参考文献   "});index.add({'id':12,'href':'/notes/docs/visual/unity/','title':"Unity",'content':"导入 .obj 文件时 x 轴会取反[1] 参考文献 [1] STACKOVERFLOW. Unity flips x coordinate in obj using importer at runtime[EB/OL](2018–08–27). https://stackoverflow.com/a/52044185.\n  目录  导入 .obj 文件时 x 轴会取反[1] 参考文献   "});index.add({'id':13,'href':'/notes/docs/tools/writing/','title':"写作",'content':"Pandoc pandoc --print-default-template=html 静态网站生成器 静态网站生成器列表：https://www.staticgen.com/。\nHugo 常用命令 # 查看程序版本 hugo version  # 创建网站 hugo new site quickstart  # 添加主题 git submodule add https://github.com/ribice/kiss.git themes/kiss  # 添加内容 hugo new posts/my-first-post.md 主题  文档：https://github.com/alex-shpak/hugo-book 博客：https://github.com/ribice/kiss  部署到 GitHub Pages 请参考 https://github.com/peaceiris/actions-gh-pages#getting-started。\nCitation Style Language Official repository for Citation Style Language (CSL) citation styles: https://github.com/citation-style-language/styles。\n目录  Pandoc 静态网站生成器  Hugo  常用命令 主题  部署到 GitHub Pages  Citation Style Language   "});index.add({'id':14,'href':'/notes/docs/tools/compress/','title':"压缩",'content':"tar 打包时排除某些目录[1] tar --exclude=\u0026#39;./folder1\u0026#39; --exclude=\u0026#39;./folder2\u0026#39; -czvf filename.tar.gz . 参考文献 [1] STACKOVERFLOW. Shell command to tar directory excluding certain files/folders[EB/OL](2009–06–11). https://stackoverflow.com/a/984259.\n  目录  tar 打包时排除某些目录[1] 参考文献   "});index.add({'id':15,'href':'/notes/docs/tools/version-control/','title':"版本控制",'content':"Git Git Submodule # 下载 submodule git submodule update --init --force --recursive --depth=1  # 更新 url git submodule set-url themes/book https://github.com/alex-shpak/hugo-book.git 目录  Git  Git Submodule    "});index.add({'id':16,'href':'/notes/docs/math/linear-algebra/','title':"线性代数",'content':"相似矩阵  同一个线性变换在不同基下的矩阵称为相似矩阵  目录  相似矩阵   "});index.add({'id':17,'href':'/notes/','title':"首页",'content':"笔记列表  数学  线性代数   视觉  Unity   工具  写作 Linux 版本控制 压缩 API   编程  TeX Python Bash Golang JavaScript CSS HTML    "});})();